import React from "react";
import style from "./style.module.css";
import { ICard } from "../../models";

interface CardProps {
  card: ICard;
}

export const Card = ({ card }: CardProps) => {
  function randomDate(start, end, startHour, endHour): string {
    var date = new Date(+start + Math.random() * (end - start));
    var hour = (startHour + Math.random() * (endHour - startHour)) | 0;
    date.setHours(hour);
    return date;
  }

  return (
    <li className={style.card}>
      <img className={style.card__img} src={card.image} alt={card.title} />
      <h3 className={style.card__title}>{card.title}</h3>
      <p className={style.card__text}>{card.description}</p>
      <p className={style.card__date}>{date}</p>
    </li>
  );
};
